import React from 'react';
import {Link, NavLink} from "react-router-dom";

const Navbar = () => {

    return (
        <div className="navBar">

            <div className="cvaNavLogo">
                <Link to="/" id="ket"> CVA Ketenzorg </Link>
            </div>

            <div className="cvaNavButtons">
                <NavLink to="/Begeleiding"> <div><p>Begeleiding</p></div> </NavLink>
                <NavLink to="/Professionals"><div>Professinoals</div> </NavLink>
                <NavLink to="/Informatie"><div> Informatie </div></NavLink>
                <NavLink to="/Contact"><div> Contact </div></NavLink>
            </div>

        </div>
    )
}

export default Navbar;
